import { ImageSource, Loader, vec } from "excalibur";
import candleOff from "./images/candle-off.png";
import candleOn from "./images/candle-on.png";

export const Resources = {
  CandleOff: new ImageSource(candleOff),
  CandleOn: new ImageSource(candleOn)
} as const;

export const loader = new Loader();
loader.logo = 'data:image/png;base64,';
loader.logoWidth = 300;
loader.logoHeight = 200;
loader.logoPosition = vec(42, 45);
loader.backgroundColor = '#65809b';

loader.startButtonFactory = () => {
  const startButton = document.createElement('button');
  startButton.classList.add('start-button');
  startButton.textContent = 'Start';
  return startButton;
};

for (const res of Object.values(Resources)) {
  loader.addResource(res);
}
